const HelpForm = ({classes}) =>
{
    const TravelToHelp = () =>
    {
        window.location.href = "http://localhost:3000/help"
    }

    return(
        <div className={classes.form}>
            <button className={classes.buttonInForm} onClick={TravelToHelp}>Помощь</button>
        </div>
    )
}

export default HelpForm;
